import React, { Component } from 'react';

class CartPage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="row" id="cart">
                {
                    localStorage.length ? (
                        <div>there is localStorage</div>
                    )
                        : (<div><div class="material-icons">
                            remove_shopping_cart
                            </div>
                            <h2>Cart is empty</h2>
                        </div>
                        )}
            </div>
        )
    }
}

export default CartPage
